import{_ as a,o as e,c as i,e as n}from"./app-91f40cf0.js";const t={},r=n('<h2 id="一定不要忘记这些物品" tabindex="-1"><a class="header-anchor" href="#一定不要忘记这些物品" aria-hidden="true">#</a> 一定不要忘记这些物品</h2><h3 id="录取通知书" tabindex="-1"><a class="header-anchor" href="#录取通知书" aria-hidden="true">#</a> 录取通知书</h3><p>报到时证明身份。</p><div class="hint-container note"><p class="hint-container-title">注</p><p>虽然忘带了也不要紧，但是会非常麻烦 (核验身份证，院长签字等)，而且您大概是不想一开学这么被导员深刻地记住的。</p></div><h3 id="身份证及正反两面复印件" tabindex="-1"><a class="header-anchor" href="#身份证及正反两面复印件" aria-hidden="true">#</a> 身份证及正反两面复印件</h3><p>身份证在做火车飞机的时候也要用的。</p><p>复印件一两张就行，无需太多。</p><h3 id="党团组织关系材料" tabindex="-1"><a class="header-anchor" href="#党团组织关系材料" aria-hidden="true">#</a> 党团组织关系材料</h3><p>省外党员需要有介绍信 (团员和省内党员无需介绍信)</p><p>团员证或党员证</p><h3 id="档案材料-仅限本科生-研究生需调档" tabindex="-1"><a class="header-anchor" href="#档案材料-仅限本科生-研究生需调档" aria-hidden="true">#</a> 档案材料 (仅限本科生，研究生需调档)</h3><p>就是高中母校交给同学们的装在牛皮档案里的材料</p><p>一般为个人档案，个人档案数据电子化的省份可能只有团籍档案</p><h3 id="现实情况调查表-仅限研究生-需盖章" tabindex="-1"><a class="header-anchor" href="#现实情况调查表-仅限研究生-需盖章" aria-hidden="true">#</a> 现实情况调查表 (仅限研究生，需盖章)</h3><p><a class="innenu-doc" href="https://assets.innenu.com/file/prepare/post-research.docx" download="东北师范大学研究生现实表现调查表"><img class="innenu-doc-icon" src="https://mp.innenu.com/data/icon/doc.svg" alt="东北师范大学研究生现实表现调查表">东北师范大学研究生现实表现调查表.docx</a></p><h3 id="一寸、小二寸照片若干张" tabindex="-1"><a class="header-anchor" href="#一寸、小二寸照片若干张" aria-hidden="true">#</a> 一寸、小二寸照片若干张</h3><p>报到时就需要交给学院、宿管阿姨一张一寸照片，所以请务必提前准备好。(也就是和录取通知书放一起！不能放在行李里！)</p><div class="hint-container tip"><p class="hint-container-title">照片用途</p><p>开学有一些手续，比如办理入住需要交照片。</p><p>另外，拍的证件照要留好电子版，很多考试报名是需要上传电子证件照。</p><p>学校有照相馆，若不小心忘带照片，可以到学校现拍。</p></div><div class="hint-container tip"><p class="hint-container-title">照片底色</p><p>党团相关一般使用红底</p><p>其他材料如个人简历等一般使用蓝底或白底。</p><p>大学英语四六级报名要求蓝底电子照。</p><p>寝室人员名册这种照片贴什么底色都行。</p></div><h3 id="特殊考生" tabindex="-1"><a class="header-anchor" href="#特殊考生" aria-hidden="true">#</a> 特殊考生</h3><ul><li><p>艺术类考生需带《东北师范大学艺术类专业考试合格证》(如果有)</p></li><li><p>公费师范生需带“本人或本人及其监护人签字的公费师范生协议书一式四份” (录取通知书内)</p></li><li><p>优师专项生需带“本人或本人及其监护人签字的优师专项协议书一式五份” (录取通知书内)</p></li></ul>',21),h=[r];function d(c,p){return e(),i("div",null,h)}const o=a(t,[["render",d],["__file","material.html.vue"]]);export{o as default};
